export default function generate(directory, registry) {
    const source = directory.createSourceFile('enums.ts', '', { overwrite: true });
    for (const [name, options] of registry.enum.entries()) {
        source.addEnum({
            name: name,
            isExported: true,
            members: Object.keys(options).map(key => ({
                name: key,
                value: options[key]
            }))
        });
    }
}
;
